public class NotebookInstanceLifecycleConfigFactory(string resourceName = null, Action<Humidifier.SageMaker.NotebookInstanceLifecycleConfig> factoryAction = null) : ResourceFactory<Humidifier.SageMaker.NotebookInstanceLifecycleConfig>(resourceName)
{

