    internal List<InnerNotebookInstanceLifecycleConfigNotebookInstanceLifecycleHookFactory> OnCreateFactories { get; set; } = [];

    protected override Humidifier.SageMaker.NotebookInstanceLifecycleConfig Create()
    {
        var notebookInstanceLifecycleConfigResult = CreateNotebookInstanceLifecycleConfig();
        factoryAction?.Invoke(notebookInstanceLifecycleConfigResult);

        return notebookInstanceLifecycleConfigResult;
    }

    private Humidifier.SageMaker.NotebookInstanceLifecycleConfig CreateNotebookInstanceLifecycleConfig()
    {
        var notebookInstanceLifecycleConfigResult = new Humidifier.SageMaker.NotebookInstanceLifecycleConfig
        {
            GivenName = InputResourceName,
        };

        return notebookInstanceLifecycleConfigResult;
    }
    public override void CreateChildren(Humidifier.SageMaker.NotebookInstanceLifecycleConfig result)
    {
        base.CreateChildren(result);

        result.OnStart = OnStartFactories.Any() ? OnStartFactories.Select(x => x.Build()).ToList() : null;
        result.OnCreate = OnCreateFactories.Any() ? OnCreateFactories.Select(x => x.Build()).ToList() : null;
    }

} // End Of Class

